/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `check_rating_size_on_insert` BEFORE INSERT ON `films` FOR EACH ROW BEGIN 
	DECLARE flag INT;
    SET flag = (
               NEW.rating BETWEEN 1 AND 10
      );
   IF flag = 0 THEN
      SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'INSERT canceled, rating has to be between 1 and 10';
   END IF;
END */;;
